import "./navbar.css";

export default function Navbar() {
  return (
    <header className="navbar navbar-top">
      <nav>
        <img>{}</img>
        <ul>
          <li><a href="#">Accueil</a></li>
          <li><a href="#"></a>Profil</li>
          <li><a href="#">Réglages</a></li>
          <li><a href="#">Communauté</a></li>
        </ul>
      </nav>
    </header>
  );
}
